import React from "react";

function Footer() {
    return (
        <footer id="Contact-Info" className="content-section">
            <div className="left-section">
                <h2>Contact Info</h2>
            </div>
            <div className="right-section">
                <ul>
                    <li>Email: asiakemp24@gmail.com</li>
                    <li>Phone: 704-310-7264</li>
                </ul>
            </div>
        </footer>
    );
}

export default Footer;
